GameConfig.Letter = {
  [1] = {
    main_text = "    也许您已经听说了，米德加尔特·卢恩王国将举办选王仪式。而作为勇敢、正直与聪慧的冒险者，您的事迹已传遍了米德加尔特大陆。现任王后凯瑟琳·乔治特此邀请您作为冒险者公会的代表参与此次仪式。\n    请您立刻出发前往王宫。",
