    Tips = "点击打开邀请函"
  },
  [4] = {
    main_text = "    独自一人冒险的还顺利吗？我现在已经来到了梦罗克，这里有些危险，好在有新的伙伴的帮助，你也要多多认识新朋友哦！\n    对了，如果你足够强大了，还是可以去找希盖伊兹导师进行二转！哦~希望你冒险一切顺利，我们能尽快再见！",
