  [5] = {
    main_text = "    在伊斯鲁德的时候非常感谢你的帮助，我现在也是伟大的魔法师团队的一份子了！但是现在有紧急情况发生，我需要你的帮助，请尽快来吉芬！\n    对了，在来吉芬前，建议你去找一趟普隆德拉的罗兰先生，他会帮助你习得一些有趣又有用的冒险家技能。",
