  },
  [6] = {
    main_text = "    经过实地调查走访，结合史料书籍，我们找到了维多纳与现在的联系。\n    在经历了梦罗克的黑暗时期后，维多纳幸存的村民们都在亚当大帝的帮助下迁入了克雷斯特汉姆。而后，维多纳经历了伊甸王国的内乱，导致黑暗力量彻底破坏了当地的生态。\n    而伊甸王国最后的血脉，亚伯王子在内乱后，宣布伊甸王国的解散。他带领着维多纳的后代们投靠了当时由特里斯坦一世刚刚成立的卢恩·米德加尔特王国，并在现在的依斯鲁德岛定居。 \n    维多纳没有消亡，他们的后裔还在这片土地上。 ",
    Honorific = "亲爱的冒险者",
    Icon = "qws_family_Kevalbauerig",
    sign_off = "",
    Tips = "点击打开信封"
  },
  [7] = {
    main_text = "    大祭司布兰迪斯大人听闻您前段时间前来艾卡拉奇，特意命我写信邀请您和原初之龙尼德霍格大人一起，再次前来艾卡拉奇商讨晨曦祭典一事。",
    Honorific = "亲爱的冒险者",
    Icon = "qws_family_Kevalbauerig",
    sign_off = "莱拉 敬上",
    Tips = "点击打开信封"
  },
  [8] = {
    main_text = "    感谢您和各位勇士的付出，为了庆祝各位击退黑暗之王，保卫吉芬，王室特意在梦罗克安排了一场庆功宴，丰富的活动和美食已经准备就绪，期待您的参与。",
    Honorific = "冒险者",
    Icon = "qws_family_Kevalbauerig",
    sign_off = "",
    Tips = "点击打开信封"
  },
  [9] = {
    main_text = "    我的线人说在里希塔乐原野的林场见到了009，我们在那里碰头。",
    Honorific = "冒险者",
    Icon = "qws_family_Kevalbauerig",
    sign_off = "拉杰尔",
    Tips = "点击打开信封"
  },
  [10] = {
    main_text = "    我的一位线人有可能能找到带走009的家伙。\n    但需要获得两位的帮忙。时间紧迫，我在艾因布洛克原野等你们，不见不散。",
    Honorific = "冒险者",
    Icon = "qws_family_Kevalbauerig",
    sign_off = "拉杰尔",
    Tips = "点击打开信封"
  },
  [11] = {
    main_text = "    国境检查站！快！",
