    Icon = "qws_family_Kevalbauerig",
    sign_off = "拉杰尔",
    Tips = "点击打开信封"
  },
  [12] = {
    main_text = "    冒险者，许久不见，没时间多寒暄了，我就直说了吧，我那任性的妹妹突然失踪，现在尼夫海姆陷入混乱，生命与死亡的界限被打破，这对大陆也有重大影响，这件事只能交给你去处理了。",
